import React, { useEffect, useRef } from 'react';
import { init } from "ityped";
import '../styles/Home.css';
import { motion } from 'framer-motion';
import { Container, Typography, Link, Grid, Box } from '@mui/material';
import BlueMoon from "../assets/BlueMoon.png";

function Home() {
    const textRef = useRef();

  // useEffect(() => {
  //   init(textRef.current, {
  //     loop: true,
  //     showCursor: true,
  //     backSpeed: 100,
  //     startDelay: 120,
  //     backDelay: 1700,
  //     strings: ["Student", "Developer", "Wonderer"],
  //   });
  // }, []);

  const variants = {
    float: { y: ["-10%", "10%"], transition: { yoyo: Infinity } }
  };

  return (
      <Container className="header" sx={{ flexGrow: 6 }}>
        <Grid container >
          <Grid item>
            <Container className="moon">
              <motion.img
                className="moon"
                src={BlueMoon}
                alt="moon"
                animate="float"
                variants={variants}
              />
            </Container>
          </Grid>

          {/* <Grid item>
            <Typography  id="phrase" variant='h1'>
              A Sense of Wonder in A World Gone Mad
            </Typography>
          </Grid> */}

        </Grid>
      </Container>
  );
}

export default Home;
